Converse-City: Central Nervous System as Spine for Interactions
GAM Jhia Hao
Abstract
The city is a place of encounters and interactions. Tay Kheng Soon’s concept of a Central Nervous System as a nexus of interactions and innovation was used as a strategy in connecting NUS Utown to One-North Fusionopolis, creating a seamless pedestrian corridor for collaborations. Using plot size and building typologies, 3 main iterations are generated to understand the implications of the pedestrian corridor on the urban form for interactions. Performative indicators like daylight and solar factor, views and active-passive areas are used to gauge the effectiveness of the windows and the buildings themselves. The results shows a mixture of courtyard and u-shaped blocks respective to the curvature of the pedestrian corridor is most suitable for a conducive environment for interactions. In addition, plot sizes and the segmentation of the site are also important elements in mixing and organizing the programs of residential, office, industrial and commercial together.

de_yuan/overview.html.body:
body {
  counter-reset: chapter 2 h1 7 h2 0 h3 0 h4 0 h5 0 h6 0;
}

Crossroads
KANG De Yuan
The proposal is initiated from an analysis of the surrounding environment, an effort to extract the innate character of the neighborhood to more sensitively respond and provide for the communities to be affected. The functions lining the periphery of the site can be categorised into either industrial or educational institutions. Utown positioned on the western edge of the site hosts also a large community of residents. 
Coupled with a projected increase in the size of the local community, there is an imminent need to consider the dynamics of the incoming community with the existing student body.
The site is envisioned to be a buffer between the community of students with the industrial section of the vicinity. The proposed design is one that is socially inclusive and engages the larger community beyond the boundaries of the site through the provision of amenities within its core. 
Crossroads represent the design strategy of intersecting axes and through the interplay of different dynamics, inject vitality into the environment. The site is divided with an introduction of axes that reflects movement patterns and the typical zoning method is adopted to better position the masterplan within its context. Plots are assigned a respective programmatic type while each type will be attributed with design conditions which govern their performance. 
A high degree of consideration was placed on the conditions of the streets as increasing pedestrian flows plays a significant part in the vision of the masterplan. The proposal therefore envisions a neighborhood that is porous to its surrounding communities and highly pedestrianized streets with an increased consideration for the shading provided by the built environment to accommodate the high degree of pedestrian traffic.

de_yuan/discussion.html.body:
body {
  counter-reset: chapter 2 h1 7 h2 4 h3 0 h4 0 h5 0 h6 0;
}

Discussion
“Crossroads” present a design strategy to integrate the industrial and residential functions through utilizing the synergy produced from the flows of pedestrian and traffic. Perpendicular axes coupled with extensive boulevards promise a pleasant ground level experience. The size of blocks are designed to match those of the surrounding so as to preserve a similar sense of scale in the neighborhood. 
Connectivity is placed as a top most priority, hence porosity of the ground level and comfort level of streets are given much consideration in the assessment of the performance of the design. 
While the final iteration produced satisfactory results in terms of the considerations mentioned, there is still room for improvement in terms of the homogeneity within each typology and their respective efficiency in terms of occupancy load. Nonetheless, this proposal will stand as a promising start to the planning of this plot of land.

