lisa/overview.html.body:
body {
  counter-reset: chapter 2 h1 10 h2 0 h3 0 h4 0 h5 0 h6 0;
}

Chaflán
KOH Lisa


     Figure: render
El Chaflán, which means 'chamfer' in Spanish, refers to chamferring of the corners of a typical urban grid. Inspired by the urban layout of the city of Barcelona, this project seeks to discover the efficiency of such a plan (widths of streets and buildings are taken from that of Barcelona's), and ways to improve on it. It also seeks to understand how well such a plan could fit into the context of Singapore.
Through 5 iterations, (1a, 1b, 2, 3a, 3b), the octogonal urban planning of Barcelona was adjusted to achieve maximum efficiency (maximum number of "good" buildings), whilst considering the different typologies (residential, commercial, industry and offices). This resulted in a densely packed, low-rise industrial zone lined alongside the busy AYE, a cluster of shopping malls close to the MRT stations, and generously spaced mixed-use residential and commercial building blocks with individual courtyards.

lisa/discussion.html.body:
body {
  counter-reset: chapter 2 h1 10 h2 6 h3 0 h4 0 h5 0 h6 0;
}

Discussion
Starting with 1.89% of "good" buildings and 35.85% of "good" windows, to finally achieve 94.95% "good" buildings and 55.75% "good" windows is fulfilling and was an interesting journey from start to end. It was also nice to learn that the octogonal building blocks in Barcelona have a low passive area ratio in the context of Singapore, hence suggesting that climate and position play a huge role urban planning. It is not intelligent to pluck an urban plan right off a country and try to fit it into another located on the other side of the globe. Through informed transformations based on the evaluation information gained through Houdini simulations, I have arrived at - what I hope - a plausible urban design fit for Singapore.
By lining the AYE with low-rise mixed-use industrial buildings (industrial and offices), it serves as a buffer for the residents residing in the area. The shopping malls located close to the MRT stations have a huge open space infront of them with the potential of hosting events and festivals, creating a flexible and lively social node in the neighbourhood. Located right beside UTown, the high number of commercial and residential would greatly benefit the students (both international and local) who seek accomodations near school, as well as students who simply need a break at a cafe, coffee shop or mall in the vicinity.
Learning Houdini is a skill that will definitely bring benefits in time to come, and I am glad I am granted this opportunity to learn it. Thank you Professor Patrick Jansen!

chung_yan/overview.html.body:
body {
  counter-reset: chapter 2 h1 11 h2 0 h3 0 h4 0 h5 0 h6 0;
}

Urban Fabric of Light
LAW Chung Yan
Abstract:
Currently, One North area is isolated and has a poor connectivity to the existent. To reconnect this spatial fragment to NUS UTown and develop it into a livable community, the transformation works involving additions such as rezoning, new programmes and building typologies is needed.
The major issue is that regeneration of urban fabric is more complicated than it sounds since we need to consider all factors comprehensively including physical, social and economic dimensions. This chapter aims at focusing on only one aspect by setting up fixed and changing variables as the first step of development. Urban blocks are developed and analyzed under a set of measurable and relevant factors of lighting. The cyclic process of urban prototyping aims to provide findings and rules scientifically.
The results show that orientation of building plays the major role in controlling heat gain and daylight access. Building setbacks and building height have weaker effect in natural lighting. Height restriction or minimum setbacks can be set up and refine under cyclic tests. The rules and would be the introduction of a thorough strategy to improve the quality of space and interconnectivity. In other words, the findings will be a design intervention for revitalizing One North area from the existing poor planning.

chung_yan/discussion.html.body:
body {
  counter-reset: chapter 2 h1 11 h2 4 h3 0 h4 0 h5 0 h6 0;
}

Discussion
We designed basic urban elements (e.g. roads, parcels, building blocks, land use, etc.) based on some common and general design understanding for the first iteration. The changes and refinements can be detected by the cyclic process of iterative methodology. Urban elements like building typologies and roads are analyzed and evaluated under measurable factors (e.g. daylight, solar gain and sky exposure). In other words, improvement of the quality and functionality of spaces can be made under the iterative design process.
Although we failed to achieve generating an urban fabric with 100% “good building”, based on the results of iterative design, we found out that orientation of building envelopes has the greatest effect on heat gain and daylight access. Restriction of building setbacks and height can be set to preserve rights to sunlight resources. Setting physical rules as design guidance can be useful for the next stage of design thinking.
Nevertheless, there are lots of limitations in my project, from the framework to structure. The base of research for this chapter barely depends on iterative design. The lack of literature reviews and case studies that related to urban fabric design cannot provide perfect solutions. Furthermore, the tests and analysis of urban prototyping are subjective and imperfect due to my limited knowledge in the field of urban planning.
Further study on the relationship among physical, social and environment dimensions for revitalization of a residential community and design regulations in Singapore would be important for further iterations to provide long-term values to theories community and a more practical solution.

