}

The Curious Case of Greens in one-north
LIM Yih Xi
The Houdini project sets off the goal to analyse the effectiveness of public greens in the urban design of towns. It challenges the widely accepted notion of the addition of green spaces in highly dense urban compactness will improve the quality of buildings in terms of vistas, daylighting and solar factor requirement for “good” building.   
Set in the one-north area, the usage of mixed-use plots provides for the expected 75,000 population moving into this site using 2-dimensional land use planning of industrial, residential, commercial and offices. The set of 3 iterations demonstrates different types of greens: iteration 1 showcases a highly built up urban grid with the leftover green spaces, iteration 2 allocates green spaces on each plot and iteration 3 combines the idea of courtyard greens and a central park.

yih_xi/discussion.html.body:
body {
  counter-reset: chapter 2 h1 15 h2 4 h3 0 h4 0 h5 0 h6 0;
}

Discussion
Green spaces present itself as an opportunity to add variance into the urban grid. It creates breathing spaces in between hard surfaces in the city. Green spaces manifest as parks, buffers, courtyards and oftentimes in a highly dense country in Singapore, they appear in leftover plots of land. It is then questionable whether the intention of planting green spaces does benefit in the alleviation of issues pertaining to vistas, increasing "good" windows and thereby, hopefully, demonstrating "good" buildings.  
This series of iterations hope to test out the effectiveness of green spaces in the urban environment. Arguably, green spaces does not necessary equate to better buildings. However, there is an impression that by implementing green spaces and allowing penetration of daylight and gaps between buildings will thereby increase the "goodness" of a building. 
One aspect to take note of is that while this exercise looks at the affectance of green spaces on the buildings surrounding it, in actuality, the intangible measurement of the quality of the streetscape and townscape that has been improved or impaired by the green spaces are not taken into accountability. The intangible value of the green spaces that creates the ambience of the environment as well as to protect and respect the biodiversity is certainly one worth analyzing as well.

zi_han/overview.html.body:
body {
  counter-reset: chapter 2 h1 16 h2 0 h3 0 h4 0 h5 0 h6 0;
}

Bent and Heterogeneous Urbanscape
LIM Zi Han
Abstract: This project seeks to continue Zaha Hadid’s concept for one-north masterplan, which aims to permit a heterogeneous urban grid with a green connector across the plot as a space for respite and connectivity. 



Figure 1 Zaha Hadid masterplan sketch. Source: Zaha Hadid architects
one-north industrial park was developed by JTC Corporation for the R&D and high technology cluster, comprising biomedical sciences, info-communication technology and media industries. Just situated in adjacency to National University of Singapore, Singapore Polytechnique and Science park.
Currently, in its adjacent plots, there is an estimated target population of 65,000 people working on the site. However, the current residential provision on one-north is only for a total population of 3015 people, in the form of service apartments, condominiums and landed housing and only 260 rooms in hotels nearby. The project explores the planning of residential and commercial mixed-used buildings to avoid the housing shortage experienced by neighbouring plots and accommodate 75,000 people whom can work and live in the same neighbourhood.

jing_si/overview.html.body:
body {
  counter-reset: chapter 2 h1 17 h2 0 h3 0 h4 0 h5 0 h6 0;
}

Clusters
PAU Jing Si
Abstract: My project aims to use the surrounding context to dissect the proposed site into several potential clusters. Three main iterations were carried out, in which, two of them having sub-iterations in attempts to improve evaluation results. The first iteration explores the potential of having three distinct clusters: work-live-play, residential and industrial. The second iteration was mainly focused on providing a research-cum-dormitory cluster for the surrounding tertiary institutions. For the first two iterations, a courtyard typology was employed and the evaluation results were not very desirable. However, after using the cross layout in Iteration 3, evaluation results improved. This suggests that the cross-layout typology might be a better alternative to the courtyard typology.

jing_si/introduction.html.body:
body {
  counter-reset: chapter 2 h1 17 h2 0 h3 0 h4 0 h5 0 h6 0;
}

Introduction



 Proposed Site
The proposed site is sandwiched in between Dover Road on the northside and one major highway on the southside, the Ayer Rajah Expressway (AYE). Mainly tertiary education institutes surround the site. Such as Anglo Chinese Junior College, Singapore Polytechnic and National University of Singapore. The surrounding site context will inform zoning strategies in   subsequent iterations to come.

jing_si/discussion.html.body:
body {
  counter-reset: chapter 2 h1 17 h2 4 h3 0 h4 0 h5 0 h6 0;
}

Discussion



 Iterations 1, 2 & 3 
Overall, comparing all three iterations, it can be observed that Iteration 3 achieved the best evaluation result with the most number of good buildings. After going through seven rounds of iterations, it was interesting to investigate what was the main cause of the bad building. Reasons for a bad building may include poor view factor, solar factor, daylight factor and passive ratio. More often than not, it is an accumulation of two or more factors. Through understanding where the problem lies, I was able to rectify each iteration and improve them. This was done by either adjusting the plot size, redistributing the plots so that they are not so close together or trying out a new building typology. Sometimes the reason behind a bad building may be due to a technical mistake. For example, in one of my iterations I realised that my office building had internal windows instead of walls. This reflected a poor daylight factor evaluation as these internal windows did not receive sunlight.

