}

Ridge
TEH Ru Yen Joey
The Ridge is located at a 75ha plot of land at Dover and is conceptualised as a continuation of urban fabric from the Natuonal University of Singapore located at Kent Ridge. The project will undergo intensification comprising of research-oriented programs and residential blocks to function as a self-sufficient mini-city. Ridge as a design concept adopts an incremental building form in the manner of intensification relevant to specific site conditions such as proximity to public transport amenities and overhead bridges. 
Urban prototyping studies were conducted with the aid of Houdini. As the impetus of the project focuses on the liveability of inhabitants, iterations were generated and evaluated based on 3 'liveability' assessment: 1. Daylight Factor 2. Solar Factor and 3. View Factor. The iterative process culminates in the identification of 'good' buildings based on certain threshold values. The exercise culminates in a largely successful iteration (Model 3b) based on lessons extracted from previous iterations. The Ridge is an example of the benefits stakeholders gain when assessment and planning is done at an early stage. 
Keywords: Liveability, intensification, daylight factor, solar factor, view factor.

joey/discussion.html.body:
body {
  counter-reset: chapter 2 h1 20 h2 4 h3 0 h4 0 h5 0 h6 0;
}

Discussion
This report reiterates the importance of planning at an early stage. Although the results may vary for the final design outcome, it provides an early assessment of the possible building typologies to adopt. It will form a fundamental direction for architects when individual plots are sold to different stakeholders. Although final Model 3b did not return a 100% ‘good’ building score, it is largely successful as there is a constant improvement of the assessment of different liveability factors beginning from Model 1b.

changren/overview.html.body:
body {
  counter-reset: chapter 2 h1 21 h2 0 h3 0 h4 0 h5 0 h6 0;
}

Simulation of apartment blocks
WANG ChangRen
Abstract: The proposal is initiated from the Ville Radieuse,and a series of residential design influenced by it. Some of them have proven to be failed works, and some are still widely recognized in some countries. These simulations aim to explore whether this mode of residence can achieve extremely high sunshine and greening based on the sacrifice of humanized design. At the same time, we also explored some more extreme developments.
The final result shows that on the basis of the guaranteed orientation, the high-density housing does give a large amount of public space on the ground, and at the same time guarantees high sunshine to the residences. If only the physical parameters are concerned and the north-south orientation is less than 20 meters.,then the higher the density of the dwelling is, the better the outcome is.

